import React from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components';
import { navBar } from '../colors/Colors'

function NavBar() {
  return (
    <Nav>
      <Link to="/">Home</Link>
    </Nav>
  );
}

const Nav = styled.nav`
  background-color: ${navBar};
`;

export default NavBar;
